import React from 'react';
import { StyledPrice } from './StyledCart';

const Price = () => {
    return (
        <StyledPrice>
            <p>Order</p>
            <p>Total</p>
            <button>Continue Orders</button>

            <button>Checkout</button>
        </StyledPrice>
    )
}

export default Price;
